import React from 'react';
import Chart from 'react-apexcharts';

const Visualization = ({ financialScore }) => {
  const chartOptions = {
    labels: ['Financial Score'],
    colors: ['#4CAF50'], // Adjust color as needed
  };

  const chartSeries = [financialScore];

  return (
    <div>
      <h2>Financial Score Visualization</h2>
      <Chart options={chartOptions} series={chartSeries} type="donut" height={350} />
    </div>
  );
};

export default Visualization;
